CREATE TABLE IF NOT EXISTS SSCORES(
IDS INTEGER  NOT NULL AUTO_INCREMENT, 
STUDENTID INTEGER NOT NULL, 
CLASSES VARCHAR(64) NOT NULL, 
TEACHER VARCHAR(128), 
TITLES VARCHAR(32), 
SUBJECTS VARCHAR(32), 
TYPES VARCHAR(32), 
MATH VARCHAR(32), 
READING VARCHAR(32), 
WRITING VARCHAR(32), 
TOTAL VARCHAR(32), 
MSCORES VARCHAR(32), 
LSCORES VARCHAR(32), 
HSCORES VARCHAR(32), 
DATES VARCHAR(32), 
SEMESTER VARCHAR(32), 
PERIODS INTEGER, 
COMMENTS VARCHAR(512), 
GROUPS INTEGER, 
DELETED CHAR(1), 
PRIMARY KEY (IDS) 
)ENGINE=MyISAM DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci AUTO_INCREMENT=1;
 

CREATE TABLE IF NOT EXISTS SCORES_REF(
IDS INTEGER  NOT NULL AUTO_INCREMENT, 
CLASSES VARCHAR(64) NOT NULL, 
GROUPS VARCHAR(128), 
SUBJECTS VARCHAR(32), 
SEMESTER VARCHAR(32), 
PERIODS INTEGER, 
DATES VARCHAR(512), 
DELETED CHAR(1), 
PRIMARY KEY (IDS) 
)ENGINE=MyISAM DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci AUTO_INCREMENT=1;
 

